import './App.css';
import Header from './Header';
import Home from './Home';
import { BrowserRouter as Router,Switch,Route } from 'react-router-dom';
import Checkout from './Checkout';


function App() {
  return (
    //BEM
    <div className="App">
      <Router>
          <Switch>
            <Route path="/login">
              <h1>Login Page</h1>
            </Route>
            <Route path="/checkout">   
              <Header/>
              <Checkout/>

            </Route>

            <Route path="/">   
              <Header/>
              <Home/>
            </Route>
          </Switch>
      </Router>

    </div>
  );
}

export default App;
